findOneAndUpdate - document query > 1000<p>So I have a collection that has over 1million documents clearly, I don't need to search 1000 or more documents as it should only be updating the latest document.</p>
<pre><code>const nowplayingData = {&quot;type&quot;:&quot;S&quot;,
                        &quot;station&quot;: req.params.stationname, 
                        &quot;song&quot;: data[1], 
                        &quot;artist&quot;: data[0], 
                        &quot;timeplay&quot;:npdate};

LNowPlaying.findOneAndUpdate( nowplayingData,
                             { $addToSet: { history: [uuid] } },
                             { upsert: true, sort: {_id:-1} }, 
                             function(err) {
                                            if (err) {
                                               console.log('ERROR when submitting round');
                                               console.log(err);
                                            }
                             });
</code></pre>
<p>I have added a sort on it, so that it is able to get the latest one first, but if the document is not in there and it's the first time the document is being added then the way the script is written will query all documents to find.</p>
<p>When really it only needs to look at the last say 100 documents or even better if <code>timeplay</code> is in the last 5 minutes.</p>

