<p>But when I try to send it to the server and print console.log(req.body.isClosed); in my backend only in the case from false to true it will print a &quot;true&quot;.
From false to true it's a &quot;undefined&quot;</p>
<p>So ya here i am i tried since 5h to fix it.
Used pure checkboxes, react-multi-switch-toggle and now mui switch...
Hope someone can help me</p>
<p>Update: When i change isClosed: isClosed ? isClosed : settings.isClosed to
isClosed: isClosed ? false: settings.isClosed</p>
<p>It works but only if my toggle is on true.
If my button is state false it will still print undefined.
So at the moment it can only send something that work when the state of of my toggle is true. It doesn't matter what i send then everything works</p>
<pre><code>import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useSelector, useDispatch } from 'react-redux';

import { systemSettings } from '../../../../../redux/actions/systemSettingsAction';
import Switch from '@mui/material/Switch';

const IsClosed = () =&gt; {
  const dispatch = useDispatch();
  useEffect(() =&gt; {
    dispatch(systemSettings());
  }, []);

  const settingsstate = useSelector((state) =&gt; state.systemSettingsReducer);
  const { settings } = settingsstate;

  const [isClosed, setIsClosed] = useState(
    settings[0]?.isClosed === true ? true : false
  );

  console.log(isClosed);
  const handleIsClosed = (event) =&gt; {
    setIsClosed(event.target.checked);
  };

  const updateInfor = () =&gt; {
    try {
      axios.patch(
        '/api/settings',
        {
          id: settings[0]?._id,
          isClosed: isClosed ? isClosed : settings.isClosed,
        }
      );
      window.location.reload(true);
    } catch (err) {}
  };

  return (
    &lt;div&gt;
      &lt;Switch
        checked={isClosed}
        onChange={handleIsClosed}
        inputProps={{ 'aria-label': 'controlled' }}
      /&gt;
      &lt;button
        onClick={updateInfor}
        className='block w-full bg-yellow-400 hover:bg-yellow-300 p-4 mt-2 rounded text-black hover:text-yellow-800 transition duration-300'
      &gt;
        Confirm
      &lt;/button&gt;
    &lt;/div&gt;
  );
};

export default IsClosed;

</code></pre>

